import React from 'react';
import Layout from '../Layout/Layout';
import './project.css';
import Card from '../Ui Kits/Cart/CT Card/Card';
import { NavLink } from 'react-router-dom';

function Project(props) {
  return (
    <div>
      <Layout>
        <div className='pr_main_div'>
          <h1>Project Category</h1>
          <div className='category'>
            <Card width='300px' height='500px'>
              <div>
                <NavLink
                  exact
                  activeClassName='menu_active'
                  className='nav-link active'
                  aria-current='page'
                  to='/'
                >
                  <img
                    className='ct__img'
                    src={require(`../Assets/Images/Project Image/javascript.png`)}
                    alt='avatar image'
                  />

                  <h1>javascript</h1>
                </NavLink>
              </div>
            </Card>
          </div>
        </div>
      </Layout>
    </div>
  );
}

export default Project;
